webpackJsonp([0xba7ff04d46a0],{532:function(e,a){e.exports={pathContext:{docHtml:'<h1>Argo CD Getting Started</h1>\n<p>An example guestbook application is provided to demonstrate how Argo CD works.</p>\n<h2>Requirements</h2>\n<ul>\n<li>Installed <a href="https://kubernetes.io/docs/tasks/tools/install-kubectl/">kubectl</a> command-line tool</li>\n<li>Have a <a href="https://kubernetes.io/docs/tasks/access-application-cluster/configure-access-multiple-clusters/">kubeconfig</a> file (default location is <code>~/.kube/config</code>).</li>\n</ul>\n<h2>1. Install Argo CD</h2>\n<pre><code class="language-bash">kubectl create namespace argocd\nkubectl apply -n argocd -f https://raw.githubusercontent.com/argoproj/argo-cd/v0.11.0-rc2/manifests/install.yaml\n</code></pre>\n<p>This will create a new namespace, <code>argocd</code>, where Argo CD services and application resources will live.</p>\n<p>NOTE:</p>\n<ul>\n<li>\n<p>On GKE with RBAC enabled, you may need to grant your account the ability to create new cluster roles</p>\n<pre><code class="language-bash">kubectl create clusterrolebinding YOURNAME-cluster-admin-binding --clusterrole=cluster-admin --user=YOUREMAIL@gmail.com\n</code></pre>\n</li>\n</ul>\n<h2>2. Download Argo CD CLI</h2>\n<p>Download the latest Argo CD version:</p>\n<p>On Mac:</p>\n<pre><code class="language-bash">brew install argoproj/tap/argocd\n</code></pre>\n<p>On Linux:</p>\n<pre><code class="language-bash">curl -sSL -o /usr/local/bin/argocd https://github.com/argoproj/argo-cd/releases/download/v0.11.0-rc2/argocd-linux-amd64\nchmod +x /usr/local/bin/argocd\n</code></pre>\n<h2>3. Access the Argo CD API server</h2>\n<p>By default, the Argo CD API server is not exposed with an external IP. To access the API server,\nchoose one of the following means to expose the Argo CD API server:</p>\n<h3>Service Type LoadBalancer</h3>\n<p>Change the argocd-server service type to <code>LoadBalancer</code>:</p>\n<pre><code class="language-bash">kubectl patch svc argocd-server -n argocd -p \'{"spec": {"type": "LoadBalancer"}}\'\n</code></pre>\n<h3>Ingress</h3>\n<p>Follow the <a href="ingress.html">ingress documentation</a> on how to configure Argo CD with ingress.</p>\n<h3>Port Forwarding</h3>\n<p><code>kubectl port-forward</code> can also be used to connect to the API server without exposing the service.\nThe API server can be accessed using the localhost address/port.</p>\n<h2>4. Login using the CLI</h2>\n<p>Login as the <code>admin</code> user. The initial password is autogenerated to be the pod name of the\nArgo CD API server. This can be retrieved with the command:</p>\n<pre><code class="language-bash">kubectl get pods -n argocd -l app=argocd-server -o name | cut -d\'/\' -f 2\n</code></pre>\n<p>Using the above password, login to Argo CD\'s external IP:</p>\n<pre><code class="language-bash">kubectl get svc -n argocd argocd-server\nargocd login &#x3C;EXTERNAL-IP>\n</code></pre>\n<p>After logging in, change the password using the command:</p>\n<pre><code class="language-bash">argocd account update-password\n</code></pre>\n<h2>5. Register a cluster to deploy apps to (optional)</h2>\n<p>This step registers a cluster\'s credentials to Argo CD, and is only necessary when deploying to\nan external cluster. When deploying internally (to the same cluster that Argo CD is running in),\n<a href="https://kubernetes.default.svc">https://kubernetes.default.svc</a> should be used as the application\'s K8s API server address.</p>\n<p>First list all clusters contexts in your current kubconfig:</p>\n<pre><code class="language-bash">argocd cluster add\n</code></pre>\n<p>Choose a context name from the list and supply it to <code>argocd cluster add CONTEXTNAME</code>. For example,\nfor docker-for-desktop context, run:</p>\n<pre><code class="language-bash">argocd cluster add docker-for-desktop\n</code></pre>\n<p>The above command installs an <code>argocd-manager</code> ServiceAccount and ClusterRole into the cluster\nassociated with the supplied kubectl context. Argo CD uses this service account token to perform its\nmanagement tasks (i.e. deploy/monitoring).</p>\n<h2>6. Create an application from a git repository location</h2>\n<h3>Creating apps via UI</h3>\n<p>Open a browser to the Argo CD external UI, and login using the credentials set in step 4, and the\nexternal IP/hostname set in step 4.</p>\n<p>Connect a git repository containing your apps if repository is private. An example repository containing a sample\nguestbook application is available at <a href="https://github.com/argoproj/argocd-example-apps.git">https://github.com/argoproj/argocd-example-apps.git</a>.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/connect_repo-0700c08fdfbc5cfbbe42d0fb19480ee2-85bfc.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 60.0990099009901%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="connect repo"\n        title=""\n        src="/static/connect_repo-0700c08fdfbc5cfbbe42d0fb19480ee2-fb8a0.png"\n        srcset="/static/connect_repo-0700c08fdfbc5cfbbe42d0fb19480ee2-1a291.png 148w,\n/static/connect_repo-0700c08fdfbc5cfbbe42d0fb19480ee2-2bc4a.png 295w,\n/static/connect_repo-0700c08fdfbc5cfbbe42d0fb19480ee2-fb8a0.png 590w,\n/static/connect_repo-0700c08fdfbc5cfbbe42d0fb19480ee2-526de.png 885w,\n/static/connect_repo-0700c08fdfbc5cfbbe42d0fb19480ee2-85bfc.png 1010w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>After connecting a git repository, select the guestbook application for creation:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/select_repo-21e36a2547bcb38c23f9fa13cafbf20b-e87d9.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 43.014301430143014%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="select repo"\n        title=""\n        src="/static/select_repo-21e36a2547bcb38c23f9fa13cafbf20b-fb8a0.png"\n        srcset="/static/select_repo-21e36a2547bcb38c23f9fa13cafbf20b-1a291.png 148w,\n/static/select_repo-21e36a2547bcb38c23f9fa13cafbf20b-2bc4a.png 295w,\n/static/select_repo-21e36a2547bcb38c23f9fa13cafbf20b-fb8a0.png 590w,\n/static/select_repo-21e36a2547bcb38c23f9fa13cafbf20b-526de.png 885w,\n/static/select_repo-21e36a2547bcb38c23f9fa13cafbf20b-e87d9.png 909w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/select_app-1c4316dc290c5c7a0fb1e3bc1e2cf321-85bfc.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 47.22772277227723%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="select app"\n        title=""\n        src="/static/select_app-1c4316dc290c5c7a0fb1e3bc1e2cf321-fb8a0.png"\n        srcset="/static/select_app-1c4316dc290c5c7a0fb1e3bc1e2cf321-1a291.png 148w,\n/static/select_app-1c4316dc290c5c7a0fb1e3bc1e2cf321-2bc4a.png 295w,\n/static/select_app-1c4316dc290c5c7a0fb1e3bc1e2cf321-fb8a0.png 590w,\n/static/select_app-1c4316dc290c5c7a0fb1e3bc1e2cf321-526de.png 885w,\n/static/select_app-1c4316dc290c5c7a0fb1e3bc1e2cf321-85bfc.png 1010w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/select_env-e323759fd9bf01b2de870223b8b20d2c-85bfc.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 47.22772277227723%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="select env"\n        title=""\n        src="/static/select_env-e323759fd9bf01b2de870223b8b20d2c-fb8a0.png"\n        srcset="/static/select_env-e323759fd9bf01b2de870223b8b20d2c-1a291.png 148w,\n/static/select_env-e323759fd9bf01b2de870223b8b20d2c-2bc4a.png 295w,\n/static/select_env-e323759fd9bf01b2de870223b8b20d2c-fb8a0.png 590w,\n/static/select_env-e323759fd9bf01b2de870223b8b20d2c-526de.png 885w,\n/static/select_env-e323759fd9bf01b2de870223b8b20d2c-85bfc.png 1010w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/create_app-9f8892aea3a3038834d404056133b38c-85bfc.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 83.06930693069307%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="create app"\n        title=""\n        src="/static/create_app-9f8892aea3a3038834d404056133b38c-fb8a0.png"\n        srcset="/static/create_app-9f8892aea3a3038834d404056133b38c-1a291.png 148w,\n/static/create_app-9f8892aea3a3038834d404056133b38c-2bc4a.png 295w,\n/static/create_app-9f8892aea3a3038834d404056133b38c-fb8a0.png 590w,\n/static/create_app-9f8892aea3a3038834d404056133b38c-526de.png 885w,\n/static/create_app-9f8892aea3a3038834d404056133b38c-85bfc.png 1010w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Creating apps via CLI</h3>\n<p>Applications can be also be created using the Argo CD CLI:</p>\n<pre><code class="language-bash">argocd app create guestbook-default --repo https://github.com/argoproj/argocd-example-apps.git --path ksonnet-guestbook\n</code></pre>\n<h2>7. Sync (deploy) the application</h2>\n<p>Once the guestbook application is created, you can now view its status:</p>\n<p>From UI:\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/guestbook-app-cf986b4ed6e707a36852838d24d5c2fc-85bfc.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.13861386138613%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="guestbook app"\n        title=""\n        src="/static/guestbook-app-cf986b4ed6e707a36852838d24d5c2fc-fb8a0.png"\n        srcset="/static/guestbook-app-cf986b4ed6e707a36852838d24d5c2fc-1a291.png 148w,\n/static/guestbook-app-cf986b4ed6e707a36852838d24d5c2fc-2bc4a.png 295w,\n/static/guestbook-app-cf986b4ed6e707a36852838d24d5c2fc-fb8a0.png 590w,\n/static/guestbook-app-cf986b4ed6e707a36852838d24d5c2fc-526de.png 885w,\n/static/guestbook-app-cf986b4ed6e707a36852838d24d5c2fc-85bfc.png 1010w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>From CLI:</p>\n<pre><code class="language-bash">$ argocd app get guestbook-default\nName:          guestbook-default\nServer:        https://kubernetes.default.svc\nNamespace:     default\nURL:           https://192.168.64.36:31880/applications/argocd/guestbook-default\nEnvironment:   default\nRepo:          https://github.com/argoproj/argocd-example-apps.git\nPath:          guestbook\nTarget:        HEAD\n\nKIND        NAME          STATUS     HEALTH\nService     guestbook-ui  OutOfSync\nDeployment  guestbook-ui  OutOfSync\n</code></pre>\n<p>The application status is initially in an <code>OutOfSync</code> state, since the application has yet to be\ndeployed, and no Kubernetes resources have been created. To sync (deploy) the application, run:</p>\n<pre><code class="language-bash">$ argocd app sync guestbook-default\nApplication:        guestbook-default\nOperation:          Sync\nPhase:              Succeeded\nMessage:            successfully synced\n\nKIND        NAME          MESSAGE\nService     guestbook-ui  service "guestbook-ui" created\nDeployment  guestbook-ui  deployment.apps "guestbook-ui" created\n</code></pre>\n<p>This command retrieves the manifests from git repository and performs a <code>kubectl apply</code> of the\nmanifests. The guestbook app is now running and you can now view its resource components, logs,\nevents, and assessed health status:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/guestbook-tree-37d9a1e8b0354e3e9b61803b187dc5b4-59900.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 72.848948374761%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="view app"\n        title=""\n        src="/static/guestbook-tree-37d9a1e8b0354e3e9b61803b187dc5b4-fb8a0.png"\n        srcset="/static/guestbook-tree-37d9a1e8b0354e3e9b61803b187dc5b4-1a291.png 148w,\n/static/guestbook-tree-37d9a1e8b0354e3e9b61803b187dc5b4-2bc4a.png 295w,\n/static/guestbook-tree-37d9a1e8b0354e3e9b61803b187dc5b4-fb8a0.png 590w,\n/static/guestbook-tree-37d9a1e8b0354e3e9b61803b187dc5b4-526de.png 885w,\n/static/guestbook-tree-37d9a1e8b0354e3e9b61803b187dc5b4-59900.png 1046w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>8. Next Steps</h2>\n<p>Argo CD supports additional features such as automated sync, SSO, WebHooks, RBAC, Projects. See the\nrest of the <a href="./">documentation</a> for details.</p>',docPath:"argo-cd/docs/getting_started",proj:"argo-cd"}}}});
